import React from 'react';

type Props = {};

const MainPage = (props: Props) => {
	return (
		<>
			<div></div>
			<div className="main-page">
				<div className="main-content">
					<div className="logo">
						<h1>SynthPiser</h1>
					</div>
				</div>
			</div>
		</>
	);
};

export default MainPage;
